import {Link} from 'react-router-dom';
import {useRef} from "react";

function Header(){
    const elNav = useRef();
    const elBuger = useRef();
    const kor = 'kor', eng = 'eng', jpa = 'jpa', chi = 'chi';

    function navigation(){
        elNav.current.classList.toggle('active');
        elBuger.current.classList.toggle('active');
    }
    return(
        <>
            <header>
                <div className='mwidth head'>
                    <Link to="/"><h1>궁궐</h1></Link>
                    <p className='bugermenu' ref={elBuger} onClick={navigation}>
                        <span></span>
                        <span></span>
                        <span></span>
                    </p>
                </div>
                <nav className='menu' ref={elNav}>
                    <div className='menu-contents'>
                        <ul>
                            <li><Link to="/gung01">경복궁</Link></li>
                            <li><Link to="/gung02">창경궁</Link></li>
                            <li><Link to="/gung03">창덕궁</Link></li>
                            <li><Link to="/gung04">덕수궁</Link></li>
                            <li><Link to="/gung05">종묘</Link></li>
                        </ul>
                        <ul>
                            <li><Link to="/login">로그인</Link></li>
                            <li><Link to="/like">좋아요</Link></li>
                            <li><Link to="/search">검색</Link></li>
                            <select name='lan'>
                                <option value={kor}>한국어</option>
                                <option value={eng}>영어</option>
                                <option value={jpa}>일본어</option>
                                <option value={chi}>중국어</option>
                            </select>
                        </ul>
                    </div>
                </nav>
            </header> 
        </>
    );
}
export default Header;
